import React ,{useEffect}from 'react';
import Layaout from '../../parcials/Layaout';
import {
    MDBCard,
    MDBCardBody,
    MDBContainer,
    MDBRow,
    MDBCol,
    MDBInput
} from 'mdbreact';
import { getTicketsSystemTransfer } from '../../../functions/ticketFunction';

const TransferSystemPage = () => {

    useEffect(() => {
        const datatickets =  getTicketsSystemTransfer()
        console.log(datatickets)
      }, []);
 
    return (
        <Layaout>
            <br></br>
            <MDBContainer>
                <MDBCard>
                    <MDBCardBody>
                        <MDBRow style={{paddingLeft: "12%"}}>
                            <MDBCol md='2'>
                                <MDBInput label='Upc' type='text' validate />
                            </MDBCol>
                            <MDBCol md='2'>
                                <MDBInput label='Alu' type='text' validate />
                            </MDBCol>
                            <MDBCol md='2'>
                                <MDBInput label='Talla' type='text' validate />
                            </MDBCol>
                            <MDBCol md='2'>
                                <MDBInput label='Factura' type='text' validate />
                            </MDBCol>
                            <MDBCol md='2'>
                                <MDBInput label='Tiendas' type='text' validate />
                            </MDBCol>
                        </MDBRow>
                    </MDBCardBody>
                </MDBCard>
            </MDBContainer>
        </Layaout>
    )
}

export default TransferSystemPage;
